import React from 'react';
import ReactDOM from 'react-dom/client';
import {Routers,BrowserRouter} from 'react-router-dom';
import App from './App';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <BrowserRouter>
      <Routers> 
        <App />
        </Routers> 
    </BrowserRouter>
);

